import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as o,e as r}from"./app-f55ccf80.js";const a={},c=r('<p>什么是协议 ? 协议是指双方，或多方，相互约定好，大家都需要遵守的规则，叫协议。</p><blockquote><p>客户端和服务器之间通信时，发送的数据，需要遵守的规则，叫HTTP 协议。HTTP 协议中的数据又叫报文</p></blockquote><h3 id="_1、请求的http-协议格式" tabindex="-1"><a class="header-anchor" href="#_1、请求的http-协议格式" aria-hidden="true">#</a> 1、请求的HTTP 协议格式</h3><p>请求分为<strong>GET</strong> 请求，和<strong>POST</strong> 请求</p><p>哪些是GET 请求，哪些是POST 请求</p><p>GET 请求有哪些：</p><blockquote><p>1、form 标签method=get 2、a 标签 3、link 标签引入css 4、Script 标签引入js 文件 5、img 标签引入图片 6、iframe 引入html 页面 7、在浏览器地址栏中输入地址后敲回车</p></blockquote><p>POST 请求有哪些：</p><blockquote><p>form 标签method=post</p></blockquote><h3 id="_2、常用的响应码说明" tabindex="-1"><a class="header-anchor" href="#_2、常用的响应码说明" aria-hidden="true">#</a> 2、常用的响应码说明</h3><ul><li>200 表示请求成功</li><li>302 表示请求重定向（明天讲）</li><li>404 表示请求服务器已经收到了，但是你要的数据不存在（请求地址错误）</li><li>500 表示服务器已经收到请求，但是服务器内部错误（代码错误）</li></ul>',11),i=[c];function l(p,s){return e(),o("div",null,i)}const _=t(a,[["render",l],["__file","http.html.vue"]]);export{_ as default};
